import React, { useState, useEffect } from 'react'
import { Link, useNavigate } from 'react-router-dom'

export default function ViewOrders() {
    const [orders, setOrders] = useState({})
    const [search, setSearch] = useState('')
    const navigate = useNavigate()
    const loadOrders = async () => {
        let response = await fetch("http://localhost:5000/api/auth/foodData", {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                email: localStorage.getItem('userEmail')
            })
        }).then(async (res) => {
            let response = await res.json()
            await setOrders(response[3]);

        })
    }
    useEffect(() => {
        loadOrders()
    }, [])
    return (
        <>
            <div>
                <nav class="navbar navbar-light bg-light">
                    <div class="container">
                        <Link className="navbar-brand fs-1 fst-italic" to="/admin">GetYourFood</Link>
                        <form class="d-flex">
                            <input class="form-control me-2 border-secondary" type="search" placeholder="Search Order" aria-label="Search" value={search} onChange={(e) => { setSearch(e.target.value) }} />
                            <button class="btn btn-outline-secondary" onClick={() => { setSearch('') }}>Search</button>
                        </form>
                    </div>
                </nav>
            </div>

            <div className='container-fluid m-auto mt-2 table-responsive  table-responsive-sm table-responsive-md' >
                <table className='table table-hover '>
                    <thead className=' text-secondary fs-4'>
                        <tr className='bg-white'>
                            <th scope='col' >Order ID</th>
                            <th scope='col' >Order Date</th>
                            <th scope='col' >Customer Email</th>
                            <th scope='col' >Product Name</th>
                            <th scope='col' >Order Date</th>
                            <th scope='col' >Product Detail</th>
                        </tr>
                    </thead>
                    <tbody>
                        {orders.length >= 1 ? orders.filter(
                            (data) => (data.email.toLowerCase().includes(search.toLowerCase())))
                            .map((order) => {

                                return (
                                    order.orders ?
                                        order.orders.order_data.slice(0).reverse().map((item) => {
                                            return (
                                                item.map((arrayData) => {
                                                    return (<>
                                                        <tbody>

                                                        </tbody>
                                                        <div  >
                                                            <div className='col-12 col-md-6 col-lg-3' >
                                                                <div className="card mt-3" style={{ width: "16rem", maxHeight: "360px" }}>
                                                                    <img src={arrayData.img} className="card-img-top" alt="..." style={{ height: "120px", objectFit: "fill" }} />
                                                                    <div className="card-body">
                                                                        <h5 className="card-title">{arrayData.name}</h5>
                                                                        <div className='container w-100 p-0' style={{ height: "38px" }}>
                                                                            <span className='m-1 d-inline  h-100 w-20 fs-6'>Qty - {arrayData.qty}</span>
                                                                            <div className=' d-inline ms-5 h-100 w-20 fs-5' >
                                                                                â‚¹{arrayData.price}/-
                                                                            </div>
                                                                            <br /><span className='m-1'>{order}</span>
                                                                        </div>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div></>
                                                    )
                                                })

                                            )
                                        }) : ""
                                )
                            }) : "You have no order"}

                    </tbody>
                </table>
            </div>

        </>
    )
}

